import axios from "axios";
import React, { useEffect, useState } from "react";
import { Button } from "react-bootstrap";
import { Link } from "react-router-dom";

const Reviews = () => {
  const [lists, listBooks] = useState([]);

  /*
  const onDelete = (id) => {
    axios
      .delete(`problem/delete/${id}`)
      .then((res) => {
        axios.get("http://localhost:8080/problem/view").then((res) => {
          const questions = res.data;
          setProblems(questions.data);
        });
      })
      .catch((err) => console.log(err));
  };
  */

  useEffect(() => {
    axios.get("http://localhost:8000/reviews").then((res) => {
      const lists = res.data;
      console.log(lists);
      listBooks(lists);
    });
  }, []);

  return (
    <div style={{color: "white"}}>
      <center>
        <h1>Reviews</h1>
      </center>
      <table className="table" style={{color: "white"}}>
        <thead>
          <tr>
            <th scope="col">ID</th>
            <th scope="col">Summary</th>
            <th scope="col">Rating</th>
          </tr>
        </thead>
        <tbody>
          {lists && lists.map((book, index) => {
            return (
              <tr key={book.isbn_id}>
                <th>{index + 1}</th>
                <td>
                    {book.summary}
                </td>
                <td>{book.rating}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
};

export default Reviews;
